import React, { useEffect, useState } from "react";
import { Thermometer, Droplets, Activity, Server, AlertCircle } from "lucide-react";
import axios from "axios";

const WelcomePage = () => {
  const [data, setData] = useState({
    totalDevices: 0,
    activeSensors: 0,
    avgTemperature: null,
    avgHumidity: null,
    activeAlerts: 0,
  });

  useEffect(() => {
    const fetchData = async () => {
      try {
        const devicesRes = await axios.get("https://sensorium-api.vercel.app/api/devices");
        const devices = devicesRes.data;
        const totalDevices = devices.length;

        let activeSensors = 0;
        const sensorPromises = devices.map((device) =>
          axios.get(`https://sensorium-api.vercel.app/api/sensors/${device.deviceId}`)
        );

        const sensorResponses = await Promise.all(sensorPromises);
        sensorResponses.forEach((res) => {
          activeSensors += res.data.length;
        });

        // Mock data
        const mockAvgTemperature = 22.5;
        const mockAvgHumidity = 65;
        const mockActiveAlerts = 2;

        setData({
          totalDevices,
          activeSensors,
          avgTemperature: mockAvgTemperature,
          avgHumidity: mockAvgHumidity,
          activeAlerts: mockActiveAlerts,
        });
      } catch (error) {
        console.error("Error fetching data:", error);
      }
    };

    fetchData();
  }, []);

  const statCards = [
    {
      title: "Total Devices",
      value: data.totalDevices,
      icon: <Server size={28} className="text-blue-600" />,
      border: "border-blue-100",
      bg: "bg-blue-50",
    },
    {
      title: "Active Sensors",
      value: data.activeSensors,
      icon: <Activity size={28} className="text-green-600" />,
      border: "border-green-100",
      bg: "bg-green-50",
    },
    {
      title: "Avg. Temperature",
      value: data.avgTemperature !== null ? `${data.avgTemperature}°C` : "N/A",
      icon: <Thermometer size={28} className="text-red-600" />,
      border: "border-red-100",
      bg: "bg-red-50",
    },
    {
      title: "Avg. Humidity",
      value: data.avgHumidity !== null ? `${data.avgHumidity}%` : "N/A",
      icon: <Droplets size={28} className="text-indigo-600" />,
      border: "border-indigo-100",
      bg: "bg-indigo-50",
    },
    {
      title: "Active Alerts",
      value: data.activeAlerts,
      icon: <AlertCircle size={28} className="text-yellow-600" />,
      border: "border-yellow-100",
      bg: "bg-yellow-50",
    },
  ];

  return (
    <div className="p-8 bg-gray-50 min-h-screen">
      {/* Header */}
      <header className="mb-10">
        <h1 className="text-3xl font-bold text-gray-900">Welcome to Sensorium</h1>
        <p className="mt-2 text-gray-600">
          Your centralized hub for monitoring{" "}
          <span className="font-medium">devices, sensors, and alerts</span>.
        </p>
      </header>

      {/* Stats Section */}
      <section>
        <h2 className="text-lg font-semibold text-gray-800 mb-5">System Overview</h2>
        <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 xl:grid-cols-5 gap-6">
          {statCards.map((card, index) => (
            <div
              key={index}
              className={`flex flex-col items-center justify-center rounded-lg border ${card.border} bg-white shadow-sm hover:shadow-md transition p-6`}
            >
              <div
                className={`flex items-center justify-center w-12 h-12 rounded-full ${card.bg} mb-3`}
              >
                {card.icon}
              </div>
              <p className="text-sm font-medium text-gray-500">{card.title}</p>
              <h3 className="text-2xl font-bold text-gray-900">{card.value}</h3>
            </div>
          ))}
        </div>
      </section>

      {/* Reports Placeholder */}
      <section className="mt-12 bg-white shadow-sm border border-gray-200 rounded-lg p-8 text-center">
        <h3 className="text-xl font-semibold text-gray-900 mb-2">Detailed Reports & Analytics</h3>
        <p className="text-gray-600 max-w-2xl mx-auto">
          Explore the <span className="font-medium text-blue-600">Reports</span> section to access
          historical trends, sensor insights, and detailed analytics.
        </p>
      </section>
    </div>
  );
};

export default WelcomePage;
